const Pokemon = ({ pokemon }) => {
    console.log(pokemon)
    Object.keys(pokemon.sprites).forEach(key => {
        console.log(key, pokemon.sprites[key])
    })

    return (
        <div>
            Pokemon
        </div>
    )
}

export default Pokemon
